    Source: "A320 E-RUDDER - SYSTEM BASELINE DESCRIPTION SA27RP1417662",
    "Specialized Glossary": "",
    Remarks:
      "The evolution to a complete fly-by-wire architecture of the A320 resulting from the E-Rudder development project, integrates among other novelties a new Flight Management and Guidance Computer for E-Rudder (FMGC-E). \r\nIn the A320 E-rudder architecture, the FAC computers are suppressed and following functions are transferred into FMGC-E computers: Flight Envelope monitoring and computation of maneuvering speed, yaw axis control in AP, all other functions included in FAC like ROPS, AFS maintenance and test processing (FIDS), consolidation of configuration data. \r\nThis new software FMGC-E including both FG and FE functions for E-Rudder will only be\r\ncompatible for E-Rudder aircraft. It is planned to have only one FMGC-E software\r\ncompatible to all engines available on E-Rudder (NEO engines) in order to simplify tests and\r\ncertification.",
