    "Specialized Glossary": "",
    Remarks:
      "The Flight Test Request (FTR) process completes the set of test requests (i.e. LTR, GTR) and addresses the necessary tests to be performed on the development aircraft in operational conditions. These tests end the integration cycles of the systems and the others parts of the aircraft. FTR can be used to complete the requirement coverage of the system but it targets first the product validation activity and end users satisfaction. It gives confidence that the systems will be mature and robust in typical operational scenarios. FTR is written by the design office and reviewed and approved by flight test and program organizations. The FTR involves the use of the template FM1406653 and of the Acceptance Criteria Checklist FM1804122.",
